import React from "react";
import "./Footer.css";
import {
  FaFacebook,
  FaLinkedin,
  FaMailBulk,
  FaPhone,
  FaSearchLocation,
  FaTwitter
} from "react-icons/fa";

const Footer = () => {
  return (
    <div className="footer">
      <div className="footer-container">
        <div className="left">
          <div className="location">
            <FaSearchLocation
              size={20}
              style={{ color: "#ffffff", marginRight: "2rem" }}
            />
            <div>
              <p>Hudiksvall</p>
              <h4>Sweden</h4>
            </div>
          </div>
          <div className="phone">
            <h4><FaPhone size={20} style={{ color: "#ffffff", marginRight: "2rem" }}  /> 1-23232-232</h4>
          </div>
          <div className="email">
            <h4> <FaMailBulk size={20} style={{ color: "#ffffff", marginRight: "2rem" }} />  dsfdfdf@dfs.se </h4>
          </div>
        </div>

        <div className="right">
          <h4>about me</h4>
          <p>    Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolor.</p>
          <div className="social"> 
            <FaFacebook size={30} style={{ color: "#ffffff", marginRight: "1rem" }} />
            <FaTwitter size={30} style={{ color: "#ffffff", marginRight: "1rem" }}  />
            <FaLinkedin size={30} style={{ color: "#ffffff", marginRight: "1rem" }} />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
